import { Flex, Menu } from "antd";
import React from "react";
import icon from "../img/icon.png";
const Sidebar = () => {
  return (
    <>
      <Flex align="center" justify="center">
        <div className="logo">
          <img src={icon} className="logo-img" />
        </div>
      </Flex>

      <Menu
        mode="inline"
        defaultSelectedKeys={["1"]}
        className="menu-bar"
      ></Menu>
    </>
  );
};

export default Sidebar;
